// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HalakList from './components/HalakList';
import HalDetails from './components/HalDetails';

const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={HalakList} />
        <Route path="/hal/:id" component={HalDetails} />
      </Switch>
    </Router>
  );
};

export default App;
